    /**
     * 二分查找法求解
     * @param s
     * @param words
     * @return
     */
    public int numMatchingSubseq(String s, String[] words) {
        //26个字母
        List<Integer>[] pos = new List[26];
        for (int i = 0; i < 26; ++i) {
            pos[i] = new ArrayList<Integer>();
        }
        for (int i = 0; i < s.length(); ++i) {
            pos[s.charAt(i) - 'a'].add(i);
        }
        int res = words.length;
        for (String w : words) {
            if (w.length() > s.length()) {
                --res;
                continue;
            }
            int p = -1;
            for (int i = 0; i < w.length(); ++i) {
                char c = w.charAt(i);
                if (pos[c - 'a'].isEmpty() || pos[c - 'a'].get(pos[c - 'a'].size() - 1) <= p) {
                    --res;
                    break;
                }
                p = binarySearch(pos[c - 'a'], p);
            }
        }
        return res;
    }

    public int binarySearch(List<Integer> list, int target) {
        int left = 0, right = list.size() - 1;
        while (left < right) {
            int mid = left + (right - left) / 2;
            if (list.get(mid) > target) {
                right = mid;
            } else {
                left = mid + 1;
            }
        }
        return list.get(left);
    }



    public int numMatchingSubseq1(String s, String[] words) {
        int count = 0;
        for (String word : words) {
            String newString = new String(s);
            boolean exists = true;
            if(newString.indexOf(word) >= 0){
                count++;
                continue;
            }
            for (int i = 0; i < word.length(); i++) {
                final char c = word.charAt(i);
                final int i1 = newString.indexOf(c);
                if(i1 < 0){
                    exists = false;
                    break;
                }
                newString = newString.substring(i1 + 1,newString.length());
            }
            if (exists){
                count++;
            }
        }
        return count;
    }
